 missed this. For now, let's require that elements in a ratio should always be positive whole numbers (not zero, not negative -- we never use those cases).", 'comment_created': datetime.datetime(2020, 8, 18, 22, 30, 14, tzinfo=datetime.timezone.utc), 'commenter': 'seanlip', 'type': 'User'}, {'comment_id': 472732993, 'comment_body': 'not after changing it to list of numbers', 'comment_created': datetime.datetime(2020, 8, 19, 5, 56, 26, tzinfo=datetime.timezone.utc), 'commenter': 'aggarwalpulkit596', 'type': 'User'}, {'comment_id': 472736157, 'comment_body': 'done', 'comment_created': datetime.datetime(2020, 8, 19, 6, 1, 3, tzinfo=datetime.timezone.utc), 'commenter': 'aggarwalpulkit596', 'type': 'User'}, {'comment_id': 473687669, 'comment_body': 'done', 'comment_created': datetime.datetime(2020, 8, 20, 7, 22, 18, tzinfo=datetime.timezone.utc), 'commenter': 'aggarwalpulkit596', 'type': 'User'}, {'comment_id': 473687803, 'comment_body': 'done', 'comment_created': datetime.datetime(2020, 8, 20, 7, 22, 29, tzinfo=datetime.timezone.utc), 'commenter': 'aggarwalpulkit596', 'type': 'User'}, {'comment_id': 473687932, 'comment_body': 'not valid anymore', 'comment_created': datetime.datetime(2020, 8, 20, 7, 22, 40, tzinfo=datetime.timezone.utc), 'commenter': 'aggarwalpulkit596', 'type': 'User'}, {'comment_id': 473688281, 'comment_body': 'done', 'comment_created': datetime.datetime(2020, 8, 20, 7, 23, 3, tzinfo=datetime.timezone.utc), 'commenter': 'aggarwalpulkit596', 'type': 'User'}, {'comment_id': 473688354, 'comment_body': 'not valid anymore', 'comment_created': datetime.datetime(2020, 8, 20, 7, 23, 9, tzinfo=datetime.timezone.utc), 'commenter': 'aggarwalpulkit596', 'type': 'User'}, {'comment_id': 473958841, 'comment_body': "This error seems to occur even if the rule is 'IsEqualsTo', which doesn't seem right? Since there may be cases where the creator can expect exactly equal to '2:4', and not 1:2 or 3:6.", 'comment_created': datetime.datetime(2020, 8, 20, 13, 14, 9, tzinfo=da