Also, please add documentation for this function since it may not be obvious to the reader what 'simplest form' means in this context.", 'comment_created': datetime.datetime(2020, 8, 25, 7, 30, 30, tzinfo=datetime.timezone.utc), 'commenter': 'BenHenning', 'type': 'User'}, {'comment_id': 476236071, 'comment_body': "We call these 'components' on Android. Let's be consistent.", 'comment_created': datetime.datetime(2020, 8, 25, 7, 30, 43, tzinfo=datetime.timezone.utc), 'commenter': 'BenHenning', 'type': 'User'}, {'comment_id': 476236675, 'comment_body': "It seems like this should actually be part of the ratio object, not a generic function for checking if two arrays of numbers are equal (e.g., it's more semantically meaningful & relevant to be checking the equality of two ratios instead).", 'comment_created': datetime.datetime(2020, 8, 25, 7, 31, 54, tzinfo=datetime.timezone.utc), 'commenter': 'BenHenning', 'type': 'User'}, {'comment_id': 476237306, 'comment_body': "It may be cleaner to return a ratio object here rather than an array of numbers. Using 'Ratio' everywhere that we can seems preferable since it's a dedicated & semantically defined type to represent ratios vs. a more generic array of numbers.", 'comment_created': datetime.datetime(2020, 8, 25, 7, 33, 5, tzinfo=datetime.timezone.utc), 'commenter': 'BenHenning', 'type': 'User'}, {'comment_id': 476237726, 'comment_body': "Shouldn't we just be checking if it contains a non-integer? E.g. ``/[^\d:]?/g``", 'comment_created': datetime.datetime(2020, 8, 25, 7, 33, 51, tzinfo=datetime.timezone.utc), 'commenter': 'BenHenning', 'type': 'User'}, {'comment_id': 476240033, 'comment_body': '0/0 would lead to undefined value.', 'comment_created': datetime.datetime(2020, 8, 25, 7, 38, 11, tzinfo=datetime.timezone.utc), 'commenter': 'aggarwalpulkit596', 'type': 'User'}, {'comment_id': 476240665, 'comment_body': '```suggestion
  it('should return the correct length of list', () => {
```

Also, this doesn't quite read correctly. The full test would read "Ratio Object Factory should return the correct length of list" but what you're really testing is ``getNumberOfTerms``. See other test suites for an example. In cases like this, we usually cascade the describes to make the suite clearer, e.g.:

```typescript
describe('RatioObjectFactory', () => {
  describe('.getNumberOfTerms()', () => {
    it('should return the number of components', () => {
      ...
    })
  })
})
```

In this way, the test is contextualized.

